import React, {Component} from 'react';
import {Form, Input, Message, Button} from 'semantic-ui-react';
class ContributeForm extends Component{
  render(){
    return(
        <Form>
        <Form.Field>
        <label>Amount to send to child account</label>
          <Input
            label="ether"
            labelPosition="right"
          />
        </Form.Field>
        <Button primary>
          Send
        </Button>
        </Form>
    )
  }
}
export default ContributeForm;
